import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  // Sponsorship Form State
  const [sponsorData, setSponsorData] = useState({
    sponsor_name: '', sponsor_phone: '', farmer_name: '', amount: '', crop: '', quantity: ''
  });
  // Produce Form State
  const [produceData, setProduceData] = useState({
    farmer_name: '', farmer_phone: '', crop: '', quantity: '', price_per_kg: ''
  });
  // Buy Form State
  const [buyData, setBuyData] = useState({
    produce_id: '', buyer_name: '', buyer_phone: ''
  });

  const handleChange = (setData) => (e) => {
    setData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = (url, data, successMsg) => async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(`http://127.0.0.1:8000${url}`, data);
      console.log('Success:', response.data);
      alert(successMsg);
    } catch (error) {
      console.error('Error:', error.response?.data || error);
      alert('Failed to process request.');
    }
  };

  return (
    <div className="App">
      <h1>AgriTech Prototype</h1>

      {/* Sponsorship Form */}
      <h2>Create Sponsorship</h2>
      <form onSubmit={handleSubmit('/api/sponsorship/sponsor/', sponsorData, 'Sponsorship created!')}>
        <input name="sponsor_name" placeholder="Sponsor Name" value={sponsorData.sponsor_name} onChange={handleChange(setSponsorData)} />
        <input name="sponsor_phone" placeholder="Sponsor Phone" value={sponsorData.sponsor_phone} onChange={handleChange(setSponsorData)} />
        <input name="farmer_name" placeholder="Farmer Name" value={sponsorData.farmer_name} onChange={handleChange(setSponsorData)} />
        <input name="amount" type="number" placeholder="Amount" value={sponsorData.amount} onChange={handleChange(setSponsorData)} />
        <input name="crop" placeholder="Crop" value={sponsorData.crop} onChange={handleChange(setSponsorData)} />
        <input name="quantity" type="number" placeholder="Quantity" value={sponsorData.quantity} onChange={handleChange(setSponsorData)} />
        <button type="submit">Create Sponsorship</button>
      </form>

      {/* Produce Form */}
      <h2>List Produce</h2>
      <form onSubmit={handleSubmit('/api/marketplace/list/', produceData, 'Produce listed!')}>
        <input name="farmer_name" placeholder="Farmer Name" value={produceData.farmer_name} onChange={handleChange(setProduceData)} />
        <input name="farmer_phone" placeholder="Farmer Phone" value={produceData.farmer_phone} onChange={handleChange(setProduceData)} />
        <input name="crop" placeholder="Crop" value={produceData.crop} onChange={handleChange(setProduceData)} />
        <input name="quantity" type="number" placeholder="Quantity" value={produceData.quantity} onChange={handleChange(setProduceData)} />
        <input name="price_per_kg" type="number" placeholder="Price per kg" value={produceData.price_per_kg} onChange={handleChange(setProduceData)} />
        <button type="submit">List Produce</button>
      </form>

      {/* Buy Form */}
      <h2>Buy Produce</h2>
      <form onSubmit={handleSubmit('/api/marketplace/buy/', buyData, 'Purchase completed!')}>
        <input name="produce_id" type="number" placeholder="Produce ID" value={buyData.produce_id} onChange={handleChange(setBuyData)} />
        <input name="buyer_name" placeholder="Buyer Name" value={buyData.buyer_name} onChange={handleChange(setBuyData)} />
        <input name="buyer_phone" placeholder="Buyer Phone" value={buyData.buyer_phone} onChange={handleChange(setBuyData)} />
        <button type="submit">Buy Produce</button>
      </form>
    </div>
  );
}

export default App;
